import React from 'react';
import './App.css';
import ChatBot from 'react-simple-chatbot';
import logo from './invstr-logo.png'
import { Typography, Container } from '@material-ui/core';
import { ParallaxProvider, ParallaxBanner, Parallax } from 'react-scroll-parallax';


const steps = [
  {
    id: '0',
    message: 'Welcome to react chatbot!',
    trigger: '1',
  },
  {
    id: '1',
    message: 'Bye!',
    end: true,
  },
];


function App() {
  return (
    <ParallaxProvider>
      <Container style={{backgroundColor:"red", paddingTop:20}}>
        <Parallax className="arrow-2" y={[-0, 30]}>
          <img style={{width:75}} src={logo}/>
          <Typography variant={'h6'} style={{color:"white"}}>Hey There</Typography>
          <Typography variant={'body'} style={{color:"white"}}>Every year, there are billions of empty car seats going between cities, leading to congestion and pollution. We’re building the world’s strongest community of travelers to help solve this problem and make travel more human and pleasant.</Typography>
        </Parallax>
        <Parallax  className="arrow-2" y={[10, 0]}>
          <div style={{backgroundColor:"green"}}>
            <img style={{width:75}} src={logo}/>
            <Typography variant={'h6'} style={{color:"white"}}>Hey There</Typography>
            <Typography variant={'body'} style={{color:"white"}}>Every year, there are billions of empty car seats going between cities, leading to congestion and pollution. We’re building the world’s strongest community of travelers to help solve this problem and make travel more human and pleasant.</Typography>
          </div>
        </Parallax>
        <Parallax  className="arrow-2" y={[0, 100]}>
          <div style={{backgroundColor:"green"}}>
            <img style={{width:75}} src={logo}/>
            <Typography variant={'h6'} style={{color:"white"}}>Hey There</Typography>
            <Typography variant={'body'} style={{color:"white"}}>Every year, there are billions of empty car seats going between cities, leading to congestion and pollution. We’re building the world’s strongest community of travelers to help solve this problem and make travel more human and pleasant.</Typography>
          </div>
        </Parallax>
        <Parallax  className="arrow-2" y={[0, 100]}>
          <div style={{backgroundColor:"green"}}>
            <img style={{width:75}} src={logo}/>
            <Typography variant={'h6'} style={{color:"white"}}>Hey There</Typography>
            <Typography variant={'body'} style={{color:"white"}}>Every year, there are billions of empty car seats going between cities, leading to congestion and pollution. We’re building the world’s strongest community of travelers to help solve this problem and make travel more human and pleasant.</Typography>
          </div>
        </Parallax>
      </Container>
    </ParallaxProvider>

  );
}

export default App;
